Subject: Thank you from NBCUniversal - ​Analyst, Commercial Analytics- Zicheng  Zhao
From: NBCUniversal Hiring Team <notifications@smartrecruiters.com>
To: zichengalexzhao@gmail.com
Date: Fri, 08 Aug 2025 17:59:27 +0000

Hi Zicheng,
Thank you for taking the time to apply for the ​Analyst, Commercial Analytics ​position at NBCUniversal. We have received and reviewed your resume and wanted to inform you that at this time we will not be moving forward with your candidacy.&nbsp;
We do appreciate you taking the time to apply and encourage you to continue to check out nbcunicareers.com and apply for jobs that match your skills and interests. &nbsp;
Thanks again for your time, we truly value your interest in NBCUniversal. &nbsp;
&nbsp;

