Plus, advice for staying centered when the world feels chaotic.View in browser|nytimes.comJune 14, 2025Good morning. Here’s the news you need to start your day:Middle East: Israel and Iran exchanged a new wave of attacks, striking one another with missiles and drones.Military parade: Tanks and troops will make their way through the streets of Washington, D.C., today.“No Kings”: Today is also expected to be the broadest day of demonstrations against President Trump’s second term, with protests in all 50 states.We have more on these stories below. But first, Melissa Kirsch writes about staying centered when the world feels chaotic.María Jesús ContrerasBreathing roomBy Melissa KirschLast week, a friend read my tarot cards. It was a lark — neither of us had much experience with the occult, but it seemed a diverting enough way to spend an evening, to engage with the messiness of our lives in a way that might offer some clarity. We drew the cards, then used the book that came with the tarot deck to interpret them. I made a note of one passage that seemed to invite further consideration: “Practice being present in the here and now. It’s all we have, and it’s a lot.”I read this two ways. On the one hand, the present moment contains a rich bounty of content. No need to trouble yourself with the past or the future, there’s abundance right here. On the other hand, I hear that understated response we often give these days when asked how we’re handling a particularly stressful moment: “It’s a lot.” In modern parlance, “It’s a lot” says a lot without saying anything specific. It encapsulates a general feeling of being overwhelmed without getting into all the reasons why.I noticed people saying “It’s a lot” early in the Covid pandemic, a slightly deadpan assertion that captured the experience of feeling swamped by a deluge of information. There’s been an uptick in “It’s a lot” in my conversations and group chats and self-reflection recently. The quantity of news we’re trying to process, and the pace at which that news seems to break, seems to require constant vigilance just to keep up. Refresh, refresh, what’s happening, what’s new. Or there are those who avoid the news altogether — it’s not just a lot, it’s too much, and they’re opting out.There has to be a middle ground, a balanced way to keep up without losing perspective, and without burying our heads in the sand. My own tactics are not that different from what the tarot advised: “Practice being present in the here and now.” What that looks like for me is deliberately feeling my feet on the firm ground, reminding myself that I’m here, in my living room or on this street or in this park. My brain may be spinning, trying to make sense of everything happening everywhere, but I’m right here on this patch of grass. I have agency. I can decide, for a minute or an hour, an afternoon or a weekend, to really try to observe what’s happening around me, to take one deep breath of this delectable spring air. There is a lot going on in the world, but there’s also a lot going on in my world that I don’t want to miss.A wise friend advised me when I was worrying recently to “move the horizon closer.” I love this. My eyes are always cast on some distant point in the future. Moving the horizon closer means to keep my thoughts and fantasies and fears contained to this plane, this moment, without spinning out into the atmosphere. The here and now is all we have, and it’s a lot, for everyone. You don’t have to consult an oracle to know this. But the reminder is useful: Where are you right now? What is happening in that space, in that moment? How can you inhabit it fully? How can you move the horizon closer?THE LATEST NEWSIran-Israel ConflictProjectiles over Israel on Friday night. Saher Alghorra for The New York TimesIsraeli aircraft bombed more nuclear facilities and military targets in Tehran last night. Iran’s U.N. ambassador said the strikes had killed 78 people over two days. Here’s the latest.Iran launched retaliatory missile strikes. Some hit buildings in Tel Aviv, killing at least three people and injuring dozens.Israel badly damaged one of Iran’s key nuclear sites. But much of the country’s nuclear program remains intact.Where were the strikes? See maps and photos here.To prepare for the attacks, Israel spent years collecting intelligence, infiltrating Iran and tracking the officers and scientists it would eventually target.Iran’s tough choice: Give up its nuclear program or respond with more force. Each option has its perils.Benjamin Netanyahu’s plan was to derail diplomatic negotiations and cripple Iran’s nuclear program. He may also want to cement his legacy in Israeli history, writes Patrick Kingsley, our Jerusalem bureau chief.D.C. ParadeThe military parade in Washington, D.C., today will celebrate the Army’s 250th anniversary. But planning documents suggest that Trump himself will be a major focus.The last time tanks paraded through the streets of Washington, just after the Gulf War, the Army was at the peak of its confidence. Today, it’s in a much more uncertain place.Weather forecasters say rainstorms might disrupt the day’s events.Other Big StoriesFlash floods overwhelmed parts of San Antonio, killing at least 11 people.Hundreds of households in eastern Oregon were evacuated because of wildfires.Viswash Kumar Ramesh was one of 242 people aboard the Air India flight when it barreled into a medical school. Here’s how the man in seat 11A became the crash’s sole survivor.Trump’s domestic policy bill would be more regressive than any major law in decades. The Upshot analyzed the tax cuts in the Republican megabill.Kim Sajet, the Smithsonian Museum director whom Trump said he would fire last month for being “partisan,” has decided to step down.THE WEEK IN CULTUREBroadwayFrom left, Marcus Choi, Helen J Shen and Dez Duron celebrating a big night for “Maybe Happy Ending.” Jutharat Pinyodoonyachet for The New York Times“Maybe Happy Ending,” a musical about love, isolation and robots in near-future South Korea, was the big winner at the Tonys. But the show’s success was far from assured when it began previews, as our theater reporter, Michael Paulson, explains:Broadway is dominated by big-brand shows — well-known titles, well-known music, well-known stars. So “Maybe Happy Ending” faced an uphill climb from the get-go. Then supply chain problems forced a monthlong postponement. Fund-raising was hard, and ticket sales were low. Things were so grim that I prepared an article about the show’s closing, to be published if it shut down.Instead, the show turned its fortunes around. Michael’s new article examines how that happened.Film and TVCeline Song’s “Materialists,” starring Dakota Johnson, Pedro Pascal and Chris Evans, is a seductive, smartly refreshed addition to the rom-com canon, our critic writes.In an interview with The Times, Song makes the case for rom-coms: “Why is it that we no longer talk about it as a serious genre about things that actually affect us and our society and our life?”A live-action remake of “How to Train Your Dragon” is out this week. Our critic called it entertaining, if somewhat mechanical. Read our review.MusicAyesha Kazim for The New York TimesThe rapper Pitbull has inspired young fans with his distinctive style — so much so that they’re donning bald caps to look like him.On the cover of her upcoming album, “Man’s Best Friend,” Sabrina Carpenter is pictured on all fours, while a faceless man grabs her hair. Some people really dislike it, The Cut reports.The genius of Sly Stone, who died this week at 82, came from his understanding of not just of harmonics but human cohesion, Wesley Morris writes.There was a commotion during Sean “Diddy” Combs’s trial yesterday when Ye, the rapper formerly known as Kanye West, entered the court building.Save up to 75% on Games. Our best offer won’t last.Add some play to your day with Wordle, Spelling Bee, Connections, the Crossword and more. Subscribe to New York Times Games and save up to 75% on your first year — get full access to our puzzle archives, play ad free in the app, use tools to help you improve and more.CULTURE CALENDARBy Alexis Soloski🎬 “28 Years Later” (Friday): Life moves pretty fast. And sometimes zombies do, too. “28 Days Later,” a bleak, slick undead flick directed by Danny Boyle and written by Alex Garland, came out in 2002. A sequel, “28 Weeks Later,” arrived in 2007. If “28 Years Later” has jumped the temporal gun, well, as many have learned to their peril, it’s hard to keep a zombie infected with rage virus down. Boyle and Garland reunite for the threequel, which picks up long after the events of the first films, as a group of survivors defend their small island community against the infected. That should go well. Aaron Taylor-Johnson, Jodie Comer and Ralph Fiennes star.RECIPE OF THE WEEKLinda Xiao for The New York Times. Food Stylist: Barrett Washburne.By Melissa ClarkOrzotto alla CarbonaraFather’s Day is tomorrow. How about cooking dinner for dear old Dad? If he’s a spaghetti carbonara lover with a sense of adventure, try Eric Kim’s orzotto alla carbonara. For an easy skillet meal, Eric swaps out the spaghetti for orzo, which he deftly cooks in chicken broth until it takes on the glossy look and creamy texture of risotto. Bits of porky guanciale (or you can use bacon), pecorino cheese and black pepper season the dish, adding brawny, salty, spicy notes. Then right at the end, he mixes in a couple of eggs to add silkiness and heft to a dish that feels both special and comforting.REAL ESTATEKatie Fahrland and her daughter Zoe in Montreal. Renaud Philippe for The New York TimesThe Hunt: After years of false starts, a Connecticut native over the overcame the red tape and moved to Montreal with her daughter. Which home did she choose? Play our game.What you get for $365,000: A bungalow in Elgin, Texas; a 1920 Craftsman house in Oklahoma City; or a 1958 cottage in Lancaster, Pa.LIVINGThe corner of Kingsland Road and Middleton Road. Jeremie Souteyrat for The New York TimesSpend 36 hours in East London: Highlights include a museum of the home, a trendy listening bar and (perhaps) the best chicken wings in the city.Not fine wine, fine water: Bottled waters from small, pristine sources are attracting a lot of buzz.Look of the week: Clothes fit for a Wonderland tea party.ADVICE FROM WIRECUTTERThe art of a great souvenirI have a distinct memory of visiting Istanbul with my family when I was 15: We spent an afternoon at the Grand Bazaar with the express purpose of buying gifts for friends back home. The task bored teenage-me, but I now know that done right, a souvenir is neither an obligation nor a flex; it’s a way to share the privilege of travel long after you’ve come home. A rule of thumb to score a great (not cheesy) souvenir: Look for a unique version of an everyday item that would be hard to come by at home. For instance, a couple of years ago, I returned from Japan with loads of fragrant tea from a city famous for its tea shops. I’ve since relied on this stash when in need of a last-minute gift that still feels special. — Brittney HoFor more travel advice, sign up for Wirecutter’s daily newsletter, where next week we’ll be diving into our best tips for weekend trips.GAME OF THE WEEKAleksander Barkov of the Panthers battling Ryan Nugent-Hopkins of the Oilers.  Lynne Sladky/Associated PressFlorida Panthers vs. Edmonton Oilers, Stanley Cup Finals: This series is tied, 2-2, after Edmonton mounted a thrilling comeback in Game 4, coming back from a 3-0 deficit to win in overtime. The Cup is now within reach for the Oilers — and for all of Canada, which has not won an N.H.L. title in more than 30 years.We reached out to Ian Austen, an Ontario native who covers Canada for The Times, and asked: What would a Stanley Cup mean for Edmonton?“When I was in Rogers Place last year during a Stanley Cup finals game, the crowd was so loud that it seemed like all of Canada had squeezed into the arena,” Ian said. “Trump’s calls for Canada’s annexation have further boosted the nation’s hopes for the Stanley Cup’s return. And Edmonton, a city whose residents often feel overlooked and misunderstood, is Canada’s current center of gravity.”Game 5 is tonight at 8 p.m. Eastern, on TNT and TruTV (and streaming on Max)NOW TIME TO PLAYHere is today’s Spelling Bee. Yesterday’s pangram was applicant.Take the news quiz to see how well you followed this week’s headlines.And here are today’s Mini Crossword, Wordle, Sudoku, Connections and Strands.Thanks for spending part of your weekend with The Times. — MelissaCorrection: The caption for a grid of photos of military parades in yesterday’s newsletter misstated the order of the photos, transposing China and North Korea.Sign up here to get this newsletter in your inbox. Reach our team at themorning@nytimes.com.Editor: Adam B. KushnerNews Editor: Tom Wright-PiersantiAssociate Editor: Lauren JacksonNews Staff: Evan Gorelick, Desiree Ibekwe, Brent Lewis, German Lopez, Ashley WuNews Assistant: Lyna BentaharSaturday Writer: Melissa KirschIf you received this newsletter from someone else, subscribe here.Need help? Review our newsletter help page or contact us for assistance.You received this email because you signed up for the Morning newsletter from The New York Times, or as part of your New York Times account.To stop receiving The Morning, unsubscribe. To opt out of other promotional emails from The Times, including those regarding The Athletic, manage your email settings.Subscribe to The TimesGet The New York Times appConnect with us on:Change Your EmailPrivacy PolicyContact UsCalifornia NoticesThe New York Times Company. 620 Eighth Avenue New York, NY 10018

