	&nbsp;
	
   


	
		
			
			
			
				
					
					
					
						
							
								
									
										 What the Capital One and Discover merger means for you
									
								
								
									
										View web version
									
								
							
						
					
					
					
				
			
			
			
		
	


	
	&nbsp;
	


    
        
            




            

                
                    
                        
                    
                

            
            




        
    


	
	&nbsp;
	
	
	



	
		
		
                      
                      
                      
                      
		
		
			
			
				Bookmark our FAQ page for more information
			
			
		
		
                      
                      
                      
                      
	



	
	&nbsp;
	
  
	
	  
		
		  
		  
		  
		  
		  
		  

			
			  
				
			  
			

		  
		  
		  
		  
		  
		  
		
	  
	

	
	&nbsp;
	
	
	
    
	  
		
		  
		  
		  
		  
		  
			

			
			  
				Discover&reg; is now part of Capital One
			  
			

		  
		  
		  
		  
		  
		  
		
	  
	
    
	
	&nbsp;
	
	
     
    
	  
		
		  
		  
		  
		  
		  
		  

			
			  
				What you need to know
			  
			

		  
		  
		  
		  
		  
		  
		
	  
	

    
	
	&nbsp;
	
	
	



	
		
		
                      
                      
                      
                      
		
		
			
			
				We&#39;re pleased to announce that on May 18, 2025, Discover Bank merged into Capital One, N.A. (“Capital One”). As a result, Capital One is now the issuer of your Discover Credit Card account. This notice applies to each Discover Credit Card account you may have. There is no action you need to take.
			
			
		
		
                      
                      
                      
                      
	




	
	&nbsp;
	
	
     
    
	  
		
		  
		  
		  
		  
		  
		  

			
			  
				What stays the same
			  
			

		  
		  
		  
		  
		  
		  
		
	  
	

    
	
	&nbsp;
	
	
	


		
			
			  
			  
			  
			  
			  
			  
				
					
					  &bull;&nbsp;
					  Account number and rewards: Your account number and rewards, if applicable, haven&#39;t changed, and you can continue to use your Discover Credit Card as you do today.
					
					
					  &bull;&nbsp;
					  Account login: Continue to manage your account using your existing user ID and password at Discover.com and in the Discover mobile app.
					
					
					  &bull;&nbsp;
					  Payments: Keep making payments as you currently do online, by phone, or by mail to the same address on your statement. If you&#39;ve chosen to use automatic payments to pay your Discover Card account, your payments will continue to be processed on the same schedule.
					
					
					  &bull;&nbsp;
					  Recurring charges: If you use Discover for any recurring charges like subscriptions or memberships, those will still be processed as usual.
					
					
					  &bull;&nbsp;
					  Benefits: Enjoy your same great Discover Card benefits, including earning unlimited cash back, daily account monitoring for fraud, and the friendly service you’ve come to expect.
					
				
			  
			  
			  
			  
			  
			  
			
		


	
	&nbsp;
	
	
     
    
	  
		
		  
		  
		  
		  
		  
		  

			
			  
				What&#39;s changing to your Cardmember Agreement
			  
			

		  
		  
		  
		  
		  
		  
		
	  
	

    
	
	&nbsp;
	
	
	



	
		
		
                      
                      
                      
                      
		
		
			
			
				Your Cardmember Agreement and any other Agreements (“Agreement”) are now between you and Capital One. This Agreement and your account are governed by applicable federal law and, to the extent state law applies, the laws of the Commonwealth of Virginia, where Capital One is headquartered.
			
			
		
		
                      
                      
                      
                      
	



 	 
	
	&nbsp;
	
	
     
    
	  
		
		  
		  
		  
		  
		  
		  

			
			  
				What happens next
			  
			

		  
		  
		  
		  
		  
		  
		
	  
	

    
	
	&nbsp;
	
	
	



	
		
		
                      
                      
                      
                      
		
		
			
			
				We&#39;re committed to a smooth transition. We&#39;ll continue to keep you updated, and you can always check our Frequently Asked Questions at Discover.com/merger for more information. If you have any questions about your Discover account, reach out like you usually do at Discover.com, in the mobile app, or by phone at 1-855-580-0821 for the same friendly, U.S.-based service you&#39;ve come to expect. And if you also have a Capital One account, please continue to contact Capital One with questions about that account.
			
			
		
		
                      
                      
                      
                      
	




	
	&nbsp;
	
	
	



	
		
		
                      
                      
                      
                      
		
		
			
			
				Safeguard your account: Scammers who claim to be Discover or Capital One may contact you asking for sensitive information. Remember, we won&#39;t contact you about these changes asking you to provide us with sensitive information, such as your card number, password, or a one-time code. If ever in doubt, please call us directly.
			
			
		
		
                      
                      
                      
                      
	



	
